import React from "react";


class Menu extends React.Component{
    constructor (props){
        super(props);
        this.state= {
            bandera: props.value
        }
    }
    render() {
        return(
            <div>
                <button>Ingresar</button>
                <button>Aceptar</button>
            </div>
        )
    }
}

export default Menu;
